import { useSelector } from "react-redux";

const PhotosContent = () => {
  const { data } = useSelector((state) => state.photos);

  return (
    <ul>
      {data.map((photo) => (
        <li></li>
      ))}
    </ul>
  );
};

export default PhotosContent;
